import {
  AUTH_LOADING
} from '../actions/auth';

export default function reducer(statePart = [], action = {}) {
  switch (action.type) {
    case AUTH_LOADING:
      return {
        ...statePart,
        loading: true
      }

    default:
      return statePart;
  }
}
